Description:
            Fabulous rhinestone chandelier earrings, dangling 3 1/2" (87 mm) from the post, with 3/8" resting on your ear lobe.  The sparkle is wonderful, with the dangling baguettes 80% sparkly.  There is one baguette on the right upper earring that looks dark in the pictures, but not to the naked eye, and is just as sparkly as the rest.  There is some darkening of the silver finish on the rear, and a gentle polishing would bring the color back.  The pictures don't do the earrings justice.  Great earrings for any dressy occasion.  Here are some other chandelier earrings: 
